  false,\n\t\"url\": null,\n\t\"notes\": \"A total of 347 bears were classified (Table
  I). The composition of the population surveyed was 90 cubs (25.9 %), 155 yearlings
  (15.9 %), 178 sows with young (22.5 %), and 124 single bears (35.7 %). The average
  litter size for cubs was 1.9 and for yearlings 1.8. The largest number of bears
  seen in a single three-hour survey was 68 on August 29.\",\n\t\"license_title\":
